(242, 'frm_addons_l', 'a:3:{s:7:\"timeout\";i:1619687258;s:5:\"value\";s:81612:\"{\"20790298\":{\"title\":\"Active Campaign\",\"name\":\"Active Campaign\",\"slug\":\"activecampaign-wordpress-plugin\",\"version\":\"1.07\",\"new_version\":\"1.07\",\"location\":[\"fp.strategy11.com\\/releases\\/activecampaign\\/formidable-activecampaign-1.07.zip\"],\"excerpt\":\"Add contacts to any ActiveCampaign list from your WordPress forms.\",\"id\":20790298,\"released\":\"2018-07-05 00:00:00\",\"categories\":[\"Elite\",\"Marketing\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/activecampaign-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/activecampaign-wordpress-plugin\\/\",\"changelog\":\"<h4>v1.07 - April 12, 2021<\\/h4>\\n<p>- Fix: Contacts were not always properly being resubscribed after unsubscribing, even when the resubscribe checkbox was checked.<br \\/>\\n- Fix: Properly send data as an array when sending data to a custom Active Campaign Checkbox field.<br \\/>\\n- Fix: Only send the file url to Active Campaign instead of the HTML display value when a file field is set.<\\/p>\\n<h4>v1.06.01 - November 3, 2020<\\/h4>\\n<ul>\\n<li>Fix: Keep the \\\"resubscribe\\\" box checked<\\/li>\\n<li>Remove the recently added Custom Automation option for opt-in since you can\'t build an automation for unconfirmed users<\\/li>\\n<\\/ul>\\n<h4>v1.06 - August 7, 2020<\\/h4>\\n<ul>\\n<li>New: Select an AC form for double opt-in<\\/li>\\n<li>New: Add option to resubscribe a contact instead of forcing it. By default, contacts will not be resubscribed.<\\/li>\\n<li>New: When a contact is updated, don\'t remove them from other lists they are on.<\\/li>\\n<li>New: Update the contact when email is changed instead of creating a new contact.<\\/li>\\n<li>Cleanup global settings and form action settings.<\\/li>\\n<li>Removed unused hidden fields in the form.<\\/li>\\n<\\/ul>\\n<h4>v1.05 - April 15, 2019<\\/h4>\\n<ul>\\n<li>Fix the icon used to create an ActiveCampaign action.<\\/li>\\n<\\/ul>\\n<h4>v1.04 - April 4, 2019<\\/h4>\\n<ul>\\n<li>New: Added option to trigger during import.<\\/li>\\n<li>Fix: The button to clear the cache wasn\'t working.<\\/li>\\n<li>Fix: This plugin was causing an error when Formidable Forms was disabled<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-activecampaign\\/formidable-activecampaign.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"337527\":{\"title\":\"Authorize.net AIM\",\"name\":\"Authorize.net AIM\",\"slug\":\"authorize-net-aim\",\"version\":\"2.01\",\"new_version\":\"2.01\",\"location\":[\"fp.strategy11.com\\/releases\\/authorize-net\\/formidable-authorize-net-2.01.zip\"],\"excerpt\":\"Accept one-time payments directly on your site, using Authorize.net AIM.\",\"id\":337527,\"released\":\"2016-04-29 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/authorize-net-aim\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/authorize-net-aim\\/\",\"changelog\":\"<h4>v2.01 - March 18, 2019<\\/h4>\\n<ul>\\n<li>Fix: Increase the timeout for creating the payment on Authorize.net in order to prevent false failures.<\\/li>\\n<li>Save the full API response in the log instead of only the body of the response for more helpful debugging messages.<\\/li>\\n<\\/ul>\\n<h4>v2.0 - February 25, 2019<\\/h4>\\n<ul>\\n<li>Requires Formidable 3.0+ and WordPress 4.7+<\\/li>\\n<li>New: Remove the Authorize.net SDK. This greatly reduces the size of the plugin, and resolves PHP 7.0+ compatibility issues.<\\/li>\\n<li>New: Use Webhooks to get notifications from Authorize.net to a REST endpoint when a payment status changes. This includes refunds, voids, and completed transactions. A webhook will be automatically created when the Formidable -&gt; Global settings page is saved.<\\/li>\\n<li>New: Added signature key to Global settings page and removed the Silent Post url. This is used to verify any incoming webhooks.<\\/li>\\n<li>New: Don\'t use MD5 verification, but meet the new sha512 requirement instead.<\\/li>\\n<li>New: Add Bangladeshi Taka currency<\\/li>\\n<li>Fix: Replace usage of deprecated file and functions from Formidable<\\/li>\\n<li>Fix: Added escaping for translatable strings.<\\/li>\\n<\\/ul>\\n<h4>v1.02 - August 31, 2018<\\/h4>\\n<ul>\\n<li>New: Delete entries that don\'t pass credit card validation<\\/li>\\n<li>New: Process shortcodes in the payment amount, description, and actions after payment. This includes default values, field values, and regular WP shortcodes.<\\/li>\\n<li>New: Allow the api key to be overridden with constants. The Authorize account can be set with AUTHORIZENET_TRANSACTION_KEY and AUTHORIZENET_API_LOGIN_ID<\\/li>\\n<li>New: Disable live mode for non-ssl sites. Show the settings and always allow test mode.<\\/li>\\n<li>New: Add option to register user after successful payment<\\/li>\\n<li>New: Add payment triggers to api action<\\/li>\\n<li>New: Add receipt ID shortcode<\\/li>\\n<li>New: Add Pakistani rupee, Chinese Renminbi Yuan, South African Rand, and Sri Lankan Rupee to currency options<\\/li>\\n<li>New: If PayPal is also installed, show the PayPal payment completed status<\\/li>\\n<li>New: Add frm_pay_[payment type]_sidebar hook for adding content to the sidebar of a single payment<\\/li>\\n<li>Fix: Include the customer info with an echeck. Show the address fields in eCheck settings. When only eCheck is selected, the extra fields were not set to show or send to Authnet<\\/li>\\n<li>Fix: Replace the included SSL cert since it is causing errors on some servers<\\/li>\\n<li>Fix: Filter description shortcodes on subscriptions page<\\/li>\\n<li>Fix: Create the post (if applicable) before fields are updated<\\/li>\\n<li>Fix: Use credit card icon instead of Stripe. This will show in 3.0.<\\/li>\\n<li>Fix: Update the gateway field for better 3.0 compatibility<\\/li>\\n<\\/ul>\\n<h4>v1.01 - December 12, 2016<\\/h4>\\n<ul>\\n<li>Prevent errors when Formidable is deactivated<\\/li>\\n<li>Add frm_authnet_invoice_num hook for setting the invoice number<\\/li>\\n<li>Add a link to view the subscriptions<\\/li>\\n<li>If the subscription has failed &gt; 3 times, set it to canceled<\\/li>\\n<li>Show more error messages to a user when the payment fails<\\/li>\\n<li>Remove plugin header for nested plugin to prevent error message when activating from the plugins upload page<\\/li>\\n<li>Use the correct currency for the total on the entry sidebar instead of defaulting to USD<\\/li>\\n<li>Allow field shortcodes in description<\\/li>\\n<li>Add Indian Rupee to currency options<\\/li>\\n<li>Add table headings and subscription description to the frm-subscriptions shortcode<\\/li>\\n<li>Prevent field ids from being used as the amount<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-authorize-net\\/formidable-authorize-net.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"168468\":{\"title\":\"AWeber\",\"name\":\"AWeber\",\"slug\":\"aweber\",\"version\":\"2.02\",\"new_version\":\"2.02\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-aweber\\/formidable-aweber-2.02.zip\"],\"excerpt\":\"AWeber is a powerful email marketing service. Subscribe contacts to an AWeber mailing list when they submit your WordPress contact forms.\",\"id\":168468,\"released\":\"2013-11-26 00:00:00\",\"categories\":[\"Creator\",\"Marketing\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-aweber\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/aweber\\/\",\"changelog\":\"<h4>v2.02 - October 14, 2020<\\/h4>\\n<ul>\\n<li>New: Add comma separated tags to your AWeber actions<\\/li>\\n<li>New: Add an ad tracking category to your AWeber actions<\\/li>\\n<li>New: Improved plugin security<\\/li>\\n<li>New: Updated the icon for AWeber in settings<\\/li>\\n<li>Fix: Support PHP 7+<\\/li>\\n<li>Fix: Add download id for more autoupdating<\\/li>\\n<li>Code: Removed Formidable &lt; v2.0 fallbacks. This version will not work with a Formidable version below 2.0.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - February 4, 2016<\\/h4>\\n<ul>\\n<li>Make sure the update notice doesn\'t show if the plugin is up to date<\\/li>\\n<\\/ul>\\n<h4>v2.0 - January 15, 2016<\\/h4>\\n<ul>\\n<li>Move the AWeber settings into a form action<\\/li>\\n<li>Make the plugin translatable<\\/li>\\n<li>Now it works with the free version of Formidable<\\/li>\\n<\\/ul>\\n<h4>v1.0.03 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Prevent errors when Formidable is disabled<\\/li>\\n<\\/ul>\\n<h4>v1.0.02 - October 16, 2015<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-aweber\\/formidable-aweber.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"168463\":{\"title\":\"Bootstrap\",\"name\":\"Bootstrap\",\"slug\":\"bootstrap\",\"version\":\"1.03\",\"new_version\":\"1.03\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-bootstrap\\/formidable-bootstrap-1.03.zip\"],\"excerpt\":\"Instantly add Bootstrap styling to all your Formidable forms.\",\"id\":168463,\"released\":\"2014-08-05 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-bootstrap\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/bootstrap\\/\",\"changelog\":\"<h4>vv1.03 - January 18, 2021<\\/h4>\\n<ul>\\n<li>This update requires action. After updating, click the link to migrate the old settings.<strong> If you save a form with Bootstrap field options before running this migration, you risk losing those settings.<\\/strong><\\/li>\\n<li>New: Moved Prepend and Append Bootstrap field options to Before Input and After Input.<\\/li>\\n<li>New: Errors are now shown by default and can no longer be turned off<\\/li>\\n<li>New: Improved plugin security<\\/li>\\n<li>New: Added bootstrap CSS file directly into plugin for GDPR compliance<\\/li>\\n<\\/ul>\\n<h4>v1.02.02 - October 9, 2017<\\/h4>\\n<ul>\\n<li>Enhancement: Allow prepend and append options with dropdowns.<\\/li>\\n<\\/ul>\\n<h4>v1.02.01 - March 8, 2017<\\/h4>\\n<ul>\\n<li>Enhancement: Update Bootstrap version to 3.3.7.<\\/li>\\n<li>Enhancement: Add prepend and append options to Lookup &gt; Text fields<\\/li>\\n<\\/ul>\\n<h4>v1.02 - December 13, 2016<\\/h4>\\n<ul>\\n<li>Enhancement: Update Bootstrap version to 3.3.6.<\\/li>\\n<li>Fix: Make sure modified [input] tag works well with Bootstrap append.<\\/li>\\n<li>Fix: Add Bootstrap ID so automatic updates work in the future.<\\/li>\\n<li>Fix: Make sure Lookup checkbox and radio fields look nice.<\\/li>\\n<\\/ul>\\n<h4>v1.01.04 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Prevent errors with Formidable disabled<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-bootstrap\\/formidable-bootstrap.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"185013\":{\"title\":\"Bootstrap Modal\",\"name\":\"Bootstrap Modal\",\"slug\":\"bootstrap-modal\",\"version\":\"2.0\",\"new_version\":\"2.0\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-modal\\/formidable-modal-2.0.zip\"],\"excerpt\":\"Open forms, views, other shortcodes, or sections of content in a Bootstrap popup.\",\"id\":185013,\"released\":\"2015-08-26 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/bootstrap-modal\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/bootstrap-modal\\/\",\"changelog\":\"<h4>v2.0 - August 21, 2017<\\/h4>\\n<ul>\\n<li>Add a new shortcode format for more flexibility. Now you can include whatever you\'d like in the modal.<br \\/>\\n[ frmmodal-content]content here[\\/frmmodal-content]<\\/li>\\n<li>Add frm_modal_shortcode action hook. This is for triggering external scripts that are loaded too late when they aren\'t triggered until the footer.<\\/li>\\n<li>Add modal_class shortcode option. This will add a class to the generated modal.<\\/li>\\n<\\/ul>\\n<h4>v1.04 - April 4, 2016<\\/h4>\\n<ul>\\n<li>Allow size=small or size=large to change the modal size<\\/li>\\n<li>Add modal_title parameter to the shortcode<\\/li>\\n<li>Make sure modal works when no forms are present on the page<\\/li>\\n<li>Fix plugin URI<\\/li>\\n<\\/ul>\\n<h4>v1.03 - January 18, 2016<\\/h4>\\n<ul>\\n<li>Make sure multiple modals on a page work correctly<\\/li>\\n<\\/ul>\\n<h4>v1.02 - December 17, 2015<\\/h4>\\n<ul>\\n<li>Show an icon to close the modal<\\/li>\\n<li>Allow any shortcode to be used for the modal content. For example, use [ frmmodal type=\\\"frm-login\\\" label=\\\"Login\\\"] to show a login form when the registration plugin is active.<\\/li>\\n<li>When the license number is saved, make sure it\'s for the correct plugin<\\/li>\\n<\\/ul>\\n<h4>v1.01 - November 24, 2015<\\/h4>\\n<ul>\\n<li>Allow classes to be added to the modal link. [ frmmodal id=5 label=\\\"click here\\\" class=\\\"your classes here\\\"]<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-modal\\/formidable-modal.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"20891694\":{\"title\":\"Campaign Monitor\",\"name\":\"Campaign Monitor\",\"slug\":\"campaign-monitor\",\"version\":\"1.03\",\"new_version\":\"1.03\",\"location\":[\"fp.strategy11.com\\/releases\\/campaign-monitor\\/formidable-campaignmonitor-1.03.zip\"],\"excerpt\":\"Save time by automatically sending leads from WordPress forms to Campaign Monitor.\",\"id\":20891694,\"released\":\"2019-06-17 00:00:00\",\"categories\":[\"Business\",\"Marketing\"],\"docs\":\"\\/knowledgebase\\/campaign-monitor-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/campaign-monitor\\/\",\"changelog\":\"\",\"plugin\":\"formidable-campaignmonitor\\/formidable-campaignmonitor.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"20826884\":{\"title\":\"Constant Contact\",\"name\":\"Constant Contact\",\"slug\":\"constant-contact\",\"version\":\"1.02\",\"new_version\":\"1.02\",\"location\":[\"fp.strategy11.com\\/releases\\/constant-contact\\/formidable-constantcontact-1.02.zip\"],\"excerpt\":\"Setup WordPress forms to create leads automatically in Constant Contact. Just select a list and match up form fields.\",\"id\":20826884,\"released\":\"2018-10-15 00:00:00\",\"categories\":[\"Business\",\"Marketing\"],\"docs\":\"\\/knowledgebase\\/constant-contact-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/constant-contact\\/\",\"changelog\":\"<h4>v1.02 - December 12, 2019<\\/h4>\\n<ul>\\n<li>New: Make authenticating easier<\\/li>\\n<li>Show more helpful error messages in the global settings and in the form action<\\/li>\\n<li>Use icon instead of image for form action<\\/li>\\n<li>Update form action layout to match v4.0<\\/li>\\n<li>Remove debug mode in favor of logging<\\/li>\\n<li>Fix: When different forms are used to update a contact, only the most recent info was saved and previous values were removed (ie custom fields, selected lists)<\\/li>\\n<li>Fix: If a contact was deleted in Constant Contact, it was causing a failure when updating the contact from Formidable<\\/li>\\n<\\/ul>\\n<h4>v1.01 - October 31, 2018<\\/h4>\\n<ul>\\n<li>Fix: On first install, the Global settings page was not loaded correctly<\\/li>\\n<li>Fix: Allow the debug mode checkbox to be unchecked<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-constantcontact\\/formidable-constantcontact.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"20247260\":{\"title\":\"Datepicker Options\",\"name\":\"Datepicker Options\",\"slug\":\"datepicker-options\",\"version\":\"1.03\",\"new_version\":\"1.03\",\"location\":[\"fp.strategy11.com\\/releases\\/dates\\/formidable-dates-1.03.zip\"],\"excerpt\":\"Add more options to date fields in your forms for so only the dates you choose can be chosen.\",\"id\":20247260,\"released\":\"2018-07-30 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/datepicker-options\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/datepicker-options\\/\",\"changelog\":\"<h4>v1.03 - March 8, 2021<\\/h4>\\n<ul>\\n<li>Fix: Date pickers were breaking inside repeaters.<\\/li>\\n<li>Fix: Prevent a warning that was appearing when importing forms with date values.<\\/li>\\n<li>Fix: Prevent a warning when formidable free is not active.<\\/li>\\n<\\/ul>\\n<h4>v1.02 - February 15, 2021<\\/h4>\\n<ul>\\n<li>Fix: Inline date pickers would cause an infinite loop for most date formats.<\\/li>\\n<li>Fix: Blocked dates were not getting blocked if the blocked dates were the only custom setting.<\\/li>\\n<li>Fix: Inline date pickers were not automatically updating calculations when the date was changed.<\\/li>\\n<\\/ul>\\n<h4>v1.01 - June 18, 2020<\\/h4>\\n<ul>\\n<li>When one field depends on another for the min or max date, set it immediately even if the first field doesn\'t have extra datepicker settings.<\\/li>\\n<li>Fix: The inline datepicker wasn\'t always being displayed depending on the settings.<\\/li>\\n<li>Fix: Use the correct start and end years if the years setting is different from the min and max dates.<\\/li>\\n<li>Fix: More reliably set the minimum and maximum dates.<\\/li>\\n<li>Fix: If a minimum date is set don\'t force it for the default date.<\\/li>\\n<li>Fix: A PHP error that was showing when a field had no settings saved.<\\/li>\\n<\\/ul>\\n<h4>v1.0.04 - June 10, 2019<\\/h4>\\n<ul>\\n<li>Fix: Inline datepickers were selecting a default date that wasn\'t allowed with some configurations<\\/li>\\n<li>Fix: Settings to select days of the week weren\'t appearing up in 4.0.<\\/li>\\n<li>Cleanup settings for 4.0<\\/li>\\n<\\/ul>\\n<h4>v1.0.03 - March 18, 2019<\\/h4>\\n<ul>\\n<li>Add minimized js and add pot file.<\\/li>\\n<li>Fix the datepicker appearance in backend settings when the front-end Formidable css is not loaded.<\\/li>\\n<li>Fix error when Formidable Forms is disabled.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-dates\\/formidable-dates.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"26596685\":{\"title\":\"Directory\",\"name\":\"Directory\",\"slug\":\"directory\",\"version\":\"1.0\",\"new_version\":\"1.0\",\"location\":[\"fp.strategy11.com\\/releases\\/directory\\/formidable-directory-1.0.zip\"],\"excerpt\":\"Get an instant business, team, or member directory. Choose a layout, select a page, and you\'re done.\",\"id\":26596685,\"released\":\"2020-06-29 00:00:00\",\"categories\":[\"Solution\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/formidable-directory\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/wordpress-directory-plugin\\/\",\"changelog\":\"\",\"plugin\":\"formidable-directory\\/formidable-directory.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"beta\":{\"version\":\"100\",\"location\":[\"fp.strategy11.com\\/form-templates\\/business-directory.xml\"]}},\"20897348\":{\"title\":\"Export View to CSV\",\"name\":\"Export View to CSV\",\"slug\":\"export-view\",\"version\":\"1.03\",\"new_version\":\"1.03\",\"location\":[\"fp.strategy11.com\\/releases\\/export-view\\/formidable-export-view-1.03.zip\"],\"excerpt\":\"Easily create custom CSV files and allow users to export their data from the front-end of your site.\",\"id\":20897348,\"released\":\"2019-08-01 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/table-view-to-csv\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/export-view\\/\",\"changelog\":\"<p>No Changes Found<\\/p>\\n\",\"plugin\":\"formidable-export-view\\/formidable-export-view.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"326042\":{\"title\":\"Form Action Automation\",\"name\":\"Form Action Automation\",\"slug\":\"autoresponder\",\"version\":\"2.04\",\"new_version\":\"2.04\",\"location\":[\"fp.strategy11.com\\/releases\\/autoresponder\\/formidable-autoresponder-2.04.zip\"],\"excerpt\":\"Schedule email notifications, SMS messages, and API actions.\",\"id\":326042,\"released\":\"2016-09-21 00:00:00\",\"categories\":[\"Elite\",\"Marketing\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/schedule-autoresponder\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/autoresponder\\/\",\"changelog\":\"<h4>v2.04 - January 13, 2021<\\/h4>\\n<ul>\\n<li>Improve the way entry limits are tracked, and only store them when the limit is set. This saves database space and improves efficiency.<\\/li>\\n<li>Use local times for all the time stamps to make the logging and scheduled list more clear.<\\/li>\\n<li>When a form is duplicated, update the automation settings to match up with the duplicated fields.<\\/li>\\n<li>Fix: Prevent Zapier from triggering twice<\\/li>\\n<\\/ul>\\n<h4>v2.03 - May 30, 2019<\\/h4>\\n<ul>\\n<li>Update the settings layout a bit for Formidable v4.0<\\/li>\\n<li>Code: Add automation for plugin releases<\\/li>\\n<li>Code: Update for better WordPress code styling<\\/li>\\n<\\/ul>\\n<h4>v2.02 - November 7, 2018<\\/h4>\\n<ul>\\n<li>New: Allow user registration to be scheduled with the automation settings<\\/li>\\n<li>Fix: When a form action is disabled, don\'t trigger it with the automation<\\/li>\\n<\\/ul>\\n<h4>v2.01 - August 1, 2018<\\/h4>\\n<ul>\\n<li>Fix: Replace __DIR__ for php 5.2 support<\\/li>\\n<li>Fix: Prevent php warning with empty dates<\\/li>\\n<li>Fix: Switch to non-deprecated save_settings function<\\/li>\\n<li>A bunch of codestyling changes, messages for translators, and escape translated strings<\\/li>\\n<\\/ul>\\n<h4>v2.0 - September 18, 2017<\\/h4>\\n<ul>\\n<li>New: Trigger automation by date + time when time fields are included in the form<\\/li>\\n<li>Tweak: Add entry and action to frm_autoresponder_time hook<\\/li>\\n<li>Tweak: Change naming to Automation instead of Autoresponder to indicate expanded functionality<\\/li>\\n<li>Tweak: Large refactoring in the code behind the scenes<\\/li>\\n<li>Fix: Show the queued time in the current site timezone<\\/li>\\n<li>Fix: Remove queued events when an entry is deleted<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-autoresponder\\/formidable-autoresponder.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"168072\":{\"title\":\"Formidable API\",\"name\":\"Formidable API\",\"slug\":\"formidable-api\",\"version\":\"1.08\",\"new_version\":\"1.08\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-api\\/formidable-api-1.08.zip\"],\"excerpt\":\"Add a full forms API for forms, form fields, views, and entries. Then send submissions to other sites with REST APIs.\",\"id\":168072,\"released\":\"2016-06-08 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-api\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-api\\/\",\"changelog\":\"<h4>v1.08 - May 27, 2019<\\/h4>\\n<ul>\\n<li>New: Add exclude_script and exclude_style parameters to the frm-api shortcode for excluding specific styles and scripts.<\\/li>\\n<li>New: When using the frm-api shortcode, scripts included on the page will be automatically excluded to prevent duplication.<\\/li>\\n<li>Don\'t allow GET access to field routes for those who don\'t have access to view forms on the back end.<\\/li>\\n<li>Switch shortcodes in data settings when form is duplicated.<\\/li>\\n<li>Fix: Javascript was not included with views, so shortcodes like frm-entry-update-field did not respond.<\\/li>\\n<li>Fix: Clicking the + row button quickly was creating duplicate rows.<\\/li>\\n<li>Fix: The ... was missing in 4.0 for newly added data rows. This fix requires Formidable v4.0.02<\\/li>\\n<\\/ul>\\n<h4>v1.07 - December 26, 2018<\\/h4>\\n<ul>\\n<li>Fix: multiple files were not correctly attached to the created entry<\\/li>\\n<li>Fix: when a file was created via the API, it was being duplicated on the receiving end<\\/li>\\n<li>Fix: When the API plugin is active, and Formidable is not, there was an error when creating a new page with the new WP editor<\\/li>\\n<\\/ul>\\n<h4>v1.06 - October 8, 2018<\\/h4>\\n<ul>\\n<li>New: Add image importing via the REST API. Now an image can be uploaded from another site when the URL is included in the API request.<\\/li>\\n<li>Fix: Prevent CORS error with ajax calls. This resolves issues with double submissions, redirecting with validation errors, and adding rows in a repeater.<\\/li>\\n<li>Fix: The returned form object was different after a form was edited than after create or get.<\\/li>\\n<\\/ul>\\n<h4>v1.05.01 - August 22, 2018<\\/h4>\\n<ul>\\n<li>Fix issue with file fields not saving the received value<\\/li>\\n<\\/ul>\\n<h4>v1.05 - July 27, 2018<\\/h4>\\n<ul>\\n<li>New: Add start_date and end_date parameters to filter the route to get entries<\\/li>\\n<li>Fix: Add better functionality to the search parameter in the route to get entries<\\/li>\\n<li>Fix: Allow the registration validation to trigger during API call<\\/li>\\n<li>Fix: reCaptcha was returning an error when creating an entry<\\/li>\\n<li>Fix: Creating an entry that included dynamic fields was causing a fatal error by using deprecated functions<\\/li>\\n<li>Fix: The route to create a form wasn\'t working correctly<\\/li>\\n<li>Remove old sslverify =&gt; false lines since they are no longer recommended<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-api\\/formidable-api.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"20834175\":{\"title\":\"Formidable Payments\",\"name\":\"Formidable Payments\",\"slug\":\"formidable-payments\",\"version\":\"1.14\",\"new_version\":\"1.14\",\"location\":[\"fp.strategy11.com\\/releases\\/payments\\/formidable-payments-1.14.zip\"],\"excerpt\":\"\",\"id\":20834175,\"released\":\"2018-11-06 12:08:25\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-payments\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"93790\":{\"title\":\"Formidable Pro\",\"name\":\"Formidable Pro\",\"slug\":\"formidable-pro\",\"version\":\"4.10.02\",\"new_version\":\"4.10.02\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-pro-4.10.02.zip\"],\"excerpt\":\"\",\"id\":93790,\"released\":\"2010-02-01 16:27:26\",\"categories\":[\"Basic\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-pro\\/\",\"changelog\":\"<h4>v4.10.02 - April 28, 2021<\\/h4>\\n<ul>\\n<li>New: Some suspicious spam file names will now be automatically filtered. This filter can be adjusted with the frm_filename_spam_keywords hook. You can read more about this <a href=\\\"https:\\/\\/formidableforms.com\\/knowledgebase\\/frm_filename_spam_keywords\\/\\\">here<\\/a>.<\\/li>\\n<li>New: Duplicated form entries now also duplicate the Post if one was created with a Post action.<\\/li>\\n<li>New: The [auto_id] shortcode will now automatically increment when used as a post title, content, slug, or excerpt.<\\/li>\\n<li>Fix: Dynamic field values were not properly importing with CSV when the options were loaded from a User ID field.<\\/li>\\n<li>Fix: Conditional date fields were occasionally calculating even when fields were hidden.<\\/li>\\n<\\/ul>\\n<h4>v4.10.01 - April 7, 2021<\\/h4>\\n<ul>\\n<li>New: Added a Post Parent field to the Create Post action.<\\/li>\\n<li>Fix: The [frm-math] shortcode was not returning a 0 value when used as [frm-math]0[\\/frm-math].<\\/li>\\n<li>Fix: Star rating fields were causing an infinite loop in rare cases when the field type has been changed.<\\/li>\\n<li>Fix: Age calculations were returning an error if the number field was conditionally hidden.<\\/li>\\n<\\/ul>\\n<h4>v4.10 - March 24, 2021<\\/h4>\\n<ul>\\n<li>Fix: Checkboxes with Other options were saving a serialized array in meta when it should have been empty. This was leaving checkboxes without any answers out of any searches for entries with a blank answer.<\\/li>\\n<li>Fix: Conditional logic was not working for some imported forms.<\\/li>\\n<li>Fix: There was an issue where the frm.min.js was being referenced when the file did not exist.<\\/li>\\n<li>Fix: Time fields were not disabling unique options on page load if there was a default date already set.<\\/li>\\n<li>Fix: There was an issue where conditional rich text editors with a default value would sometimes trigger a JavaScript error.<\\/li>\\n<li>Fix: Checkboxes with zeros for answers were not displaying in some cases, such as in an email [default-message].<\\/li>\\n<li>Fix: There was an issue with files uploaded without dropzone appearing as required even when a file was being uploaded.<\\/li>\\n<li>Fix: Empty date fields were calculating right away, showing an age before a date was ever selected.<\\/li>\\n<\\/ul>\\n<h4>v4.09.08 - March 10, 2021<\\/h4>\\n<ul>\\n<li>Fix: Products in radio buttons were not being added to the total if they were conditionally visible somewhere on a multiple page form.<\\/li>\\n<li>Fix: Prevent a warning when saving radio button updates when the submit button is not conditionally visible.<\\/li>\\n<\\/ul>\\n<h4>v4.09.07 - March 4, 2021<\\/h4>\\n<ul>\\n<li>New: Added screen reader text to Star Rating field options to make it more accessible.<\\/li>\\n<li>Fix: Some custom filter types were not properly exporting to CSV.<\\/li>\\n<li>Fix: Conditionally hidden sliders were occasionally being included in calculations.<\\/li>\\n<li>Fix: If the only calculation for a form was inside of a repeater, it was not working.<\\/li>\\n<li>Fix: Some closed forms were not pulling the closed message from settings.<\\/li>\\n<li>Fix: FrmProStatisticsController::stats_shortcode was not working for date values.<\\/li>\\n<li>Fix: Dynamic field values inside of repeater fields were not properly being exported.<\\/li>\\n<li>Fix: Required fields were validating if the sanitized value was empty.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-pro\\/formidable-pro.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-772x250.png\"},\"beta\":{\"version\":\"4.10.02p\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-pro-4.10.02p.zip\"],\"plugin\":\"formidable\\/formidable.php\"}},\"28029934\":{\"title\":\"Formidable Pro Basic\",\"name\":\"Formidable Pro Basic\",\"slug\":\"formidable-basic2\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28029934,\"released\":\"2020-11-13 12:10:10\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-basic2\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"19366995\":{\"title\":\"Formidable Pro Business Package\",\"name\":\"Formidable Pro Business Package\",\"slug\":\"formidable-pro-small-business-package\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":19366995,\"released\":\"2017-09-01 12:09:09\",\"categories\":[\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-pro-small-business-package\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.p