i>Prevent error with Formidable disabled<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-getresponse\\/formidable-getresponse.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"180495\":{\"title\":\"Highrise\",\"name\":\"Highrise\",\"slug\":\"highrise\",\"version\":\"1.06\",\"new_version\":\"1.06\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-highrise\\/formidable-highrise-1.06.zip\"],\"excerpt\":\"Capture leads in your WordPress contact forms, and save them in your Highrise CRM account too.\",\"id\":180495,\"released\":\"2013-12-12 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-highrise\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/highrise\\/\",\"changelog\":\"<h4>v1.06 - February 29, 2016<\\/h4>\\n<ul>\\n<li>Send the custom fields correctly to Highrise<\\/li>\\n<\\/ul>\\n<h4>v1.05 - February 23, 2016<\\/h4>\\n<ul>\\n<li>Fix email field settings in the Highrise action<\\/li>\\n<li>Make sure the license key is a Highrise license<\\/li>\\n<\\/ul>\\n<h4>v1.04 - February 9, 2016<\\/h4>\\n<ul>\\n<li>Added options to separate out address fields. City, State, Zip, and Country can now be mapped separately.<\\/li>\\n<li>Fixed PHP7 warnings<\\/li>\\n<\\/ul>\\n<h4>v1.03 - December 10, 2015<\\/h4>\\n<ul>\\n<li>Make it compatible with the free version of Formidable<\\/li>\\n<\\/ul>\\n<h4>v1.02 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Prevent error when Formidable is disabled<\\/li>\\n<li>Reduce duplication with initializing the api<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-highrise\\/formidable-highrise.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/2012\\/01\\/highrise.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"20811871\":{\"title\":\"HubSpot\",\"name\":\"HubSpot\",\"slug\":\"hubspot-wordpress\",\"version\":\"1.07\",\"new_version\":\"1.07\",\"location\":[\"fp.strategy11.com\\/releases\\/hubspot\\/formidable-hubspot-1.07.zip\"],\"excerpt\":\"Add contacts from your forms to HubSpot.\",\"id\":20811871,\"released\":\"2018-09-04 00:00:00\",\"categories\":[\"CRM\",\"Elite\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/hubspot-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/hubspot-wordpress\\/\",\"changelog\":\"<h4>v1.07 - January 22, 2020<\\/h4>\\n<ul>\\n<li>If the API key is missing or incorrect, allow it to be changed inside the form action<\\/li>\\n<li>Auto clear the cache when the api key is changed<\\/li>\\n<li>Include the option to set the lead source<\\/li>\\n<li>Include options from other property groups<\\/li>\\n<li>Add logging (with the Formidable Logs plugin) and remove debug mode<\\/li>\\n<li>Fix: In some cases, contacts were not being updated<\\/li>\\n<\\/ul>\\n<h4>v1.06 - February 11, 2019<\\/h4>\\n<ul>\\n<li>Allow contacts to be updated when the email address matches an existing contact<\\/li>\\n<li>Properly set and reset the cached API calls when getting properties for mapping<\\/li>\\n<li>Add a PO file<\\/li>\\n<li>Alphabetize the list of properties in the form action<\\/li>\\n<li>Include fields that may not be set as form fields in Hubspot, and exclude read only fields instead<\\/li>\\n<li>Remove the \'Default HubSpot Blog Email Subscription\' mapping to a value rather than a field in the form<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-hubspot\\/formidable-hubspot.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"170641\":{\"title\":\"Locations\",\"name\":\"Locations\",\"slug\":\"locations\",\"version\":\"2.02\",\"new_version\":\"2.02\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-locations\\/formidable-locations-2.02.zip\"],\"excerpt\":\"Populate fields with Countries, States\\/Provinces, U.S. Counties, and U.S. Cities. This data can then be used in dependent Data from Entries fields.\",\"id\":170641,\"released\":\"2014-06-21 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-locations\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/locations\\/\",\"changelog\":\"<h4>v2.02 - September 11, 2017<\\/h4>\\n<ul>\\n<li>Fix: Remove invalid city data.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - May 10, 2016<\\/h4>\\n<ul>\\n<li>Switch to using Lookup fields<\\/li>\\n<li>Add a link to reset the locations data<\\/li>\\n<\\/ul>\\n<h4>v2.0 - September 14, 2015<\\/h4>\\n<ul>\\n<li>Add options to import specific location groups<\\/li>\\n<li>Import with Ajax instead of page reloading<\\/li>\\n<li>No more annoying banners<\\/li>\\n<\\/ul>\\n<h4>v2.0b1 - August 18, 2015<\\/h4>\\n<ul>\\n<li>Add options to import specific locations<\\/li>\\n<li> Import with Ajax instead of page reloading<\\/li>\\n<li>No more annoying banners<\\/li>\\n<\\/ul>\\n<h4>v1.0.02 - June 21, 2014<\\/h4>\\n<ul>\\n<li>Fix parse error affecting some users <\\/li>\\n<li>This now requires at least v1.07.05 of Formidable<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-locations\\/us_locations.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/2013\\/04\\/locations.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"11927748\":{\"title\":\"Logs\",\"name\":\"Logs\",\"slug\":\"logs\",\"version\":\"1.0b1\",\"new_version\":\"1.0b1\",\"location\":[\"fp.strategy11.com\\/releases\\/logs\\/formidable-logs-1.0b1.zip\"],\"excerpt\":\"See your API requests along with their responses from add-ons including Zapier, Formidable API Webhooks, Salesforce and more.\",\"id\":11927748,\"released\":\"2016-12-19 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/logs\\/\",\"changelog\":\"\",\"plugin\":\"formidable-logs\\/formidable-logs.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"170655\":{\"title\":\"MailChimp\",\"name\":\"MailChimp\",\"slug\":\"mailchimp\",\"version\":\"2.05\",\"new_version\":\"2.05\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-mailchimp\\/formidable-mailchimp-2.05.zip\"],\"excerpt\":\"Get on the path to more leads in minutes. Add and update leads in a MailChimp mailing list when a form is submitted.\",\"id\":170655,\"released\":\"2013-10-17 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-mailchimp\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/mailchimp\\/\",\"changelog\":\"<h4>v2.05 - July 24, 2020<\\/h4>\\n<ul>\\n<li>New: Add support for MailChimp GDPR marketing settings. There must be a contact in the selected list before the settings will show in the form action.<\\/li>\\n<li>New: Add frm_mlcmp_tags hook for adding or removing tags.<\\/li>\\n<li>Fix: The email field wasn\'t showing in the unsubscribe settings<\\/li>\\n<\\/ul>\\n<h4>v2.04 - July 12, 2019<\\/h4>\\n<ul>\\n<li>Add support for MailChimp tags<\\/li>\\n<li>Add double opt-in for unsubscribed users that are resubscribing<\\/li>\\n<li>Add German translation<\\/li>\\n<li>Log API requests in the Formidable Logs<\\/li>\\n<li>Update the styling for the MailChimp icon in the form actions to better match 4.0<\\/li>\\n<li>Clean up the MailChimp form action settings<\\/li>\\n<li>Clarify the groups settings to make them a bit more intuitive<\\/li>\\n<li>Allow text fields to be selected for groups<\\/li>\\n<li>Show error messages along with the \'no mailing lists found\' message for easier debugging<\\/li>\\n<\\/ul>\\n<h4>v2.03 - October 26, 2017<\\/h4>\\n<ul>\\n<li>New: Add option to unsubscribe users.<\\/li>\\n<li>Enhancement: Automatically update subscriber if their email exists in the selected MailChimp list.<\\/li>\\n<li>Enhancement: Remove files and functions deprecated since version 2.0.<\\/li>\\n<\\/ul>\\n<h4>v2.02 - June 12, 2017<\\/h4>\\n<ul>\\n<li>New: Allow Formidable Address fields to be mapped to MailChimp Address fields.<\\/li>\\n<li>Enhancement: Increase limit to 50 for group options retrieved.<\\/li>\\n<li>Enhancement: Initialize database on initial install.<\\/li>\\n<li>Enhancement: Add basic PHP error log messages for failed subscription.<\\/li>\\n<li>Fix: Don\'t generate PHP error if a timeout occurs when fetching group options.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - March 30, 2017<\\/h4>\\n<ul>\\n<li>Enhancement: Increase merge and group limit to 30<\\/li>\\n<li>Fix: Improve date compatibility between MailChimp and Formidable<\\/li>\\n<li>Fix: Allow groups to be used when running free version of Formidable<\\/li>\\n<li>Fix: Store MailChimp settings as array, rather than object, in database<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-mailchimp\\/formidable-mailchimp.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/2013\\/04\\/mailchimp.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"20781560\":{\"title\":\"MailPoet Newsletters\",\"name\":\"MailPoet Newsletters\",\"slug\":\"mailpoet-newsletters\",\"version\":\"1.01\",\"new_version\":\"1.01\",\"location\":[\"fp.strategy11.com\\/releases\\/mailpoet\\/formidable-mailpoet-1.01.zip\"],\"excerpt\":\"Send WordPress newsletters from your own site with MailPoet. And use Formidable to for your newsletter signup forms.\",\"id\":20781560,\"released\":\"2018-06-05 00:00:00\",\"categories\":[\"Creator\",\"Marketing\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/mailpoet-newsletter-signup-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/mailpoet-newsletters\\/\",\"changelog\":\"<h4>v1.01 - September 14, 2018<\\/h4>\\n<ul>\\n<li>Fix error after form submit on some sites<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-mailpoet\\/formidable-mailpoet.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"163255\":{\"title\":\"Math Captcha\",\"name\":\"Math Captcha\",\"slug\":\"math-captcha\",\"version\":\"1.15\",\"new_version\":\"1.15\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-math-captcha\\/formidable-math-captcha-1.15.zip\"],\"excerpt\":\"\",\"id\":163255,\"released\":\"2015-10-12 14:00:35\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/math-captcha\\/\",\"changelog\":\"\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"172715\":{\"title\":\"PayPal Basic\",\"name\":\"PayPal Basic\",\"slug\":\"paypal-standard-single-payments\",\"version\":\"3.08\",\"new_version\":\"3.08\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-paypal\\/formidable-paypal-3.08.zip\"],\"excerpt\":\"\",\"id\":172715,\"released\":\"2015-10-21 12:20:35\",\"categories\":[\"Ecommerce\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/paypal-standard-single-payments\\/\",\"changelog\":\"<h4>v3.02 - September 14, 2018<\\/h4>\\n<ul>\\n<li>Merge the older grandfathered PayPal addon with the updated version.<\\/li>\\n<\\/ul>\\n<h4>v2.04.07 - January 25, 2015<\\/h4>\\n<ul>\\n<li>Allow amounts with . for thousands and , for decimal. If a . is used in the decimal place for the amount when the currency uses a , make it work anyway<\\/li>\\n<li>Redirect to PayPal correctly without Pro<\\/li>\\n<li>Make sure email setting is trimmed before comparing<\\/li>\\n<li>Add download ID to make sure correct license is used<\\/li>\\n<\\/ul>\\n<h4>v2.04.06 - November 17, 2015<\\/h4>\\n<ul>\\n<li>Prevent errors when updating Formidable<\\/li>\\n<\\/ul>\\n<h4>v2.04.05<\\/h4>\\n<ul>\\n<li>Format decimals with . to allow float to work correctly<\\/li>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v2.04.04<\\/h4>\\n<ul>\\n<li>Allow the amount to be included in the \\\"other\\\" option<\\/li>\\n<li>Modify the user-agent in the IPN verification to prevent errors from PayPal<\\/li>\\n<\\/ul>\\n<h4>v2.04.03<\\/h4>\\n<ul>\\n<li>Save the IPN parameters with the payment in the format that allows for multiple IPN notifications<\\/li>\\n<li>Fix sending users to Paypal when 2.x is installed, but the old settings haven\'t been moved to a form action<\\/li>\\n<li>Increased security related to XSS add_query_arg vulnerability<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"163257\":{\"title\":\"PayPal Standard\",\"name\":\"PayPal Standard\",\"slug\":\"paypal-standard\",\"version\":\"3.09\",\"new_version\":\"3.09\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-paypal\\/formidable-paypal-3.09.zip\"],\"excerpt\":\"Collect instant payments and recurring payments to automate your online business. Calculate a total and send customers on to PayPal.\",\"id\":163257,\"released\":\"2012-09-04 00:00:00\",\"categories\":[\"Business\",\"Ecommerce\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-paypal\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/paypal-standard\\/\",\"changelog\":\"<h4>v3.09 - July 30, 2019<\\/h4>\\n<ul>\\n<li>New: Account for tax when comparing amounts with the IPN<\\/li>\\n<li>Update form action icon and color<\\/li>\\n<li>Replace call to deprecated function with FrmFieldsHelper::get_user_display_name<\\/li>\\n<li>Requires Formidable v3.0+<\\/li>\\n<\\/ul>\\n<h4>v3.08 - November 18, 2017<\\/h4>\\n<ul>\\n<li>Allow field shortcodes in more payments settings so values can be set from the form: PayPal email, trial amount, repeat period, trial length. This also allows payments to go to other members on your site.<\\/li>\\n<li>Allow regular WordPress shortcodes and Formidable dynamic values (ie [email]) in addition to basic field shortcodes<\\/li>\\n<\\/ul>\\n<h4>v3.07 - November 10, 2017<\\/h4>\\n<ul>\\n<li>Process shortcodes in after payment settings. Allow entry values, default values, and other shortcodes.<\\/li>\\n<li>Clarify the payment trigger options with \\\"Successful PayPal payment\\\"<\\/li>\\n<\\/ul>\\n<h4>v3.06.01 - October 12, 2017<\\/h4>\\n<ul>\\n<li>New: Add Paypal triggers to API action.<\\/li>\\n<li>Fix: Show update notice for administrators only.<\\/li>\\n<li>Fix: Add missing close select tag in global settings.<\\/li>\\n<\\/ul>\\n<h4>v3.06 - December 9, 2016<\\/h4>\\n<ul>\\n<li>New: Add Paypal trigger to registration action for the registration 2.0 release<\\/li>\\n<li>Tweak: Don\'t add columns to entries when there is no form. This is in preparation for Formidable v2.03<\\/li>\\n<li>Tweak: If the log file setting is empty, fill it with the default setting<\\/li>\\n<li>Fix: Show correct values in the \\\"paid\\\" column on the Entries listing page if no payments have been made<\\/li>\\n<li>Fix: Add a fallback if invoice is missing from the IPN. This will help payments get matched up if the id of the payment doesn\'t get sent back to your site.<\\/li>\\n<li>Fix: Payment expiration dates are showing in 1970<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-paypal\\/formidable-paypal.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/formidable\\/PayPal-form-action.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"209561\":{\"title\":\"Polylang\",\"name\":\"Polylang\",\"slug\":\"polylang\",\"version\":\"1.08\",\"new_version\":\"1.08\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-polylang\\/formidable-polylang-1.08.zip\"],\"excerpt\":\"Create bilingual or multilingual forms with help from Polylang.\",\"id\":209561,\"released\":\"2016-01-22 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-polylang\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/polylang\\/\",\"changelog\":\"<h4>v1.08 - September 30, 2020<\\/h4>\\n<ul>\\n<li>Translated more values (summary page, placeholders, validation messages with ajax turned on).<\\/li>\\n<li>Get available strings to translate from core Formidable so new settings will be immediately available for translation<\\/li>\\n<li>Adjust layout to match Formidable 4.x+<\\/li>\\n<li>Fix: Update Formidable translation page to work with current Polylang versions<\\/li>\\n<li>Fix: Formidable strings weren\'t showing on the Polylang strings page<\\/li>\\n<li>Fix: Slashes were showing in some strings related to a Polylang update<\\/li>\\n<li>Update codestyling to meet WP standards<\\/li>\\n<\\/ul>\\n<h4>v1.07 - February 8, 2018<\\/h4>\\n<ul>\\n<li>Add rootline titles to translation settings<\\/li>\\n<li>Make repeating fields translatable<\\/li>\\n<li>Fix error message when no languages have been added in Polylang<\\/li>\\n<\\/ul>\\n<h4>v1.06 - December 8, 2016<\\/h4>\\n<ul>\\n<li>Fix: Adjusted the way form strings are saved in wp_options table to resolve packet size error.<\\/li>\\n<\\/ul>\\n<h4>v1.05 - May 24, 2016<\\/h4>\\n<ul>\\n<li>Improve compatibility with Polylang 1.9+<\\/li>\\n<\\/ul>\\n<h4>v1.04 - February 11, 2016<\\/h4>\\n<ul>\\n<li>Translate Add and Remove buttons for repeating sections<\\/li>\\n<li>Clear original strings whenever a form is updated instead of only when the translation page is visited<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-polylang\\/frm-poly.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"20815759\":{\"title\":\"Quiz Maker\",\"name\":\"Quiz Maker\",\"slug\":\"quiz-maker\",\"version\":\"1.03\",\"new_version\":\"1.03\",\"location\":[\"fp.strategy11.com\\/releases\\/quiz\\/formidable-quizzes-1.03.zip\"],\"excerpt\":\"Turn your forms into automated quizzes. Add questions and submit the quiz key. Then all the grading is done for you.\",\"id\":20815759,\"released\":\"2018-09-13 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/quiz-maker-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/quiz-maker\\/\",\"changelog\":\"\",\"plugin\":\"formidable-quizzes\\/formidable-quizzes.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"20266559\":{\"title\":\"Salesforce\",\"name\":\"Salesforce\",\"slug\":\"salesforce\",\"version\":\"2.04\",\"new_version\":\"2.04\",\"location\":[\"fp.strategy11.com\\/releases\\/salesforce\\/formidable-salesforce-2.04.zip\"],\"excerpt\":\"Add new contacts and leads into your Salesforce CRM directly from the WordPress forms on your site.\",\"id\":20266559,\"released\":\"2018-05-31 00:00:00\",\"categories\":[\"CRM\",\"Elite\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/salesforce-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/salesforce\\/\",\"changelog\":\"<h4>v2.04 - December 10, 2019<\\/h4>\\n<ul>\\n<li>New: Show Salesforce Authentication errors on the global settings page<\\/li>\\n<li>Add icon in global settings<\\/li>\\n<li>Use font icon instead of image in form action<\\/li>\\n<li>Remove debug mode in favor of logging<\\/li>\\n<li>Tweak: Clear the settings cache with a link instead of ajax for more reliable cache clearing<\\/li>\\n<li>Fix: Updating data in Salesforce wasn\'t working correctly<\\/li>\\n<li>Fix: There was an error when Formidable was disabled<\\/li>\\n<\\/ul>\\n<h4>v2.03 - October 11, 2018<\\/h4>\\n<ul>\\n<li>New: Add option to update Salesforce records<\\/li>\\n<li>New: Add support for Salesforce Boolean fields<\\/li>\\n<li>Fix: Multiselect picklist fields weren\'t getting correct values from a checkbox<\\/li>\\n<li>Fix: Date fields set as a post field were sending the wrong date format<\\/li>\\n<li>Fix: Fatal error caused by date fields in certain formats<\\/li>\\n<\\/ul>\\n<h4>v2.02 - June 14, 2018<\\/h4>\\n<ul>\\n<li>Add API calls to <a href=\\\"https:\\/\\/formidableforms.com\\/features\\/api-logs\\/\\\">Logs plugin<\\/a><\\/li>\\n<li>Add more messages for debugging<\\/li>\\n<li>Fix issue with authenticating on an SSL site<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-salesforce\\/formidable-salesforce.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"163248\":{\"title\":\"Signature\",\"name\":\"Signature\",\"slug\":\"signature\",\"version\":\"2.04\",\"new_version\":\"2.04\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-signature\\/formidable-signature-2.04.zip\"],\"excerpt\":\"Add an electronic signature to your WordPress form. The visitor may write their signature with a trackpad\\/mouse or type it.\",\"id\":163248,\"released\":\"2013-03-04 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-signature\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/signature\\/\",\"changelog\":\"<h4>v2.04 - February 10, 2021<\\/h4>\\n<ul>\\n<li>New: Added the option to set <span class=\\\"blob-code-inner blob-code-marker\\\" data-code-marker=\\\"+\\\"><span class=\\\"pl-s\\\">Type It<\\/span><\\/span> as the default signature type.<\\/li>\\n<li>Fix: The clear signature button was appearing broken in Safari and Firefox.<\\/li>\\n<li>Fix: Signatures did not properly support the use_html=0 parameter.<\\/li>\\n<li>Fix: Signatures were sometimes appearing blank when exporting CSV data.<\\/li>\\n<li>Fix: In rare cases, there were issues with rendering signatures from multiple AJAX submitted forms on the same page.<\\/li>\\n<\\/ul>\\n<h4>v2.03 - September 24, 2019<\\/h4>\\n<ul>\\n<li>New: Make field labels translatable with WPML<\\/li>\\n<li>Switch back to frm font instead of Font Awesome to avoid conflicts and an external asset.<\\/li>\\n<li>Fix: Importing signatures in an entry wasn\'t working<\\/li>\\n<\\/ul>\\n<h4>v2.02 - January 30, 2019<\\/h4>\\n<ul>\\n<li>Fix: Show the signature correctly in views and emails when Pro is running<\\/li>\\n<\\/ul>\\n<h4>v2.01 - January 16, 2019<\\/h4>\\n<ul>\\n<li>New: Give the signature field a face lift and show the field in the builder<\\/li>\\n<li>New: Show the typed option by default when javascript fails instead of showing nothing<\\/li>\\n<li>New: Don\'t clear the typed box when switching tabs<\\/li>\\n<li>Fix: The signature wasn\'t showing correctly in an email<\\/li>\\n<li>Fix: The signature field wasn\'t appearing for in-place edit<\\/li>\\n<\\/ul>\\n<h4>v2.0 - January 14, 2019<\\/h4>\\n<ul>\\n<li>New: The signature value immediately creates the image when the signature is saved and saves the url of the image for easier display. On update, all previous signatures are updated to the new format saved in the database.<\\/li>\\n<li>New: Add signature support for ajax forms and repeating sections.<\\/li>\\n<li>New: Allow importing from URL and include signature URL in XML.<\\/li>\\n<li>New: Use the 3.0 field object for better forward compatibility and lower baseline memory.<\\/li>\\n<li>New: Requires Formidable 3.0+<\\/li>\\n<li>New: Combine scripts into one file, and don\'t load IE8 fallback script in all browsers.<\\/li>\\n<li>New: Keep drawn signature when switching pages and when there are form validation errors.<\\/li>\\n<li>New: Allow signature editing in single-page form until draft is submitted.<\\/li>\\n<li>Fix: Remove frm_email_value hook for newer versions of Formidable.<\\/li>\\n<li>Fix: Prevent error message when Formidable is disabled<\\/li>\\n<li>Fix: Show the signature image with https when needed<\\/li>\\n<li>Fix: The hide tabs options weren\'t saving since v3.0<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-signature\\/signature.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"310430\":{\"title\":\"Stripe\",\"name\":\"Stripe\",\"slug\":\"stripe\",\"version\":\"2.04\",\"new_version\":\"2.04\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-stripe\\/formidable-stripe-2.04.zip\"],\"excerpt\":\"Any Formidable forms on your site can accept credit card payments without users ever leaving your site.\",\"id\":310430,\"released\":\"2016-04-26 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/stripe\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/stripe\\/\",\"changelog\":\"<h4>v2.04 - February 8, 2021<\\/h4>\\n<p>New: Added better security with Stripe Connect. Now you can connect to Stripe with a click of a button and never have to copy and paste any API keys for Stripe again. <strong>It is recommended that you go to Stripe Settings and switch to the new integration as soon as possible.<\\/strong><\\/p>\\n<h4>v2.03 - September 28, 2020<\\/h4>\\n<ul>\\n<li>New: Set the default currency to the one selected in the global settings<\\/li>\\n<li>Fix: Cancelations were triggering confirmation emails instead of cancelation<\\/li>\\n<li>Fix: Prevent validation errors on the back-end when editing an entry that collects payments<\\/li>\\n<li>Fix: Correctly delete the customer number when it doesn\'t exist in Stripe. This allows for the next try to be successful.<\\/li>\\n<li>Fix: When \\\"!important\\\" is included in the form styling, is was causing a javascript error with Stripe<\\/li>\\n<li>Fix: Prevent error with Pro disabled<\\/li>\\n<li>Fix: Wrong value sent to Stripe when using a total field with default currency set to Euro<\\/li>\\n<\\/ul>\\n<h4>v2.02 - March 9, 2020<\\/h4>\\n<ul>\\n<li>Update the Stripe library.<\\/li>\\n<li>New: Include the first and last name on a newly created customer.<\\/li>\\n<li>Fix: If a payment attempt failed after the entry was created, the credit card field was hidden and couldn\'t be updated.<\\/li>\\n<li>Fix: The previous button on the same page as a credit card field wasn\'t doing anything.<\\/li>\\n<li>Fix: Payments weren\'t being collected correctly in Internet Explorer.<\\/li>\\n<li>Fix: The refund button was returning a \\\"Failed\\\" message with some payments.<\\/li>\\n<li>Fix: When the font-family setting included incorrect characters, the credit card field wasn\'t displayed.<\\/li>\\n<li>Fix: Some error messages were being bypassed like strong password and invisible recaptcha.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - September 19, 2019<\\/h4>\\n<ul>\\n<li>New: Hide the Zip\\/Postal code. It\'s not a great user experience, and isn\'t necessary.<\\/li>\\n<li>Fix: Trigger database install or upgrade when activated site wide in WP multisite.<\\/li>\\n<li>Fix: Prevent a fatal error with undefined function on some sites.<\\/li>\\n<li>Fix: Prevent issues with a subsequent payment when customer is deleted in Stripe.<\\/li>\\n<\\/ul>\\n<h4>v2.0 - September 9, 2019<\\/h4>\\n<ul>\\n<li>New: Add support for SCA, Stripe elements, and Secure 3d Payments. More styling for the new credit card field is coming with Formidable v4.02.04.<\\/li>\\n<li>New: Set the locale for the credit card field and instant error messages.<\\/li>\\n<li>New: Add option in payment form actions to authorize one-time payments without capture.<\\/li>\\n<li>New: Include an option to process one-time payments before the entry is created.<\\/li>\\n<li>New: Add minified javascript.<\\/li>\\n<li>Reverse the order of private and public keys to match Stripe account page.<\\/li>\\n<li>Hide settings in credit card field in forms with Stripe including sub field descriptions, placeholders, and options to save card info. These are no longer used with the more secure credit card field.<\\/li>\\n<li>Switch to Stripe js v3<\\/li>\\n<li>Add Bangladeshi Taka currency<\\/li>\\n<li>Fix: some API versions were returning an error when canceling a subscription.<\\/li>\\n<li>Update form action icon<\\/li>\\n<li>Remove incorrect edit link for a subscription<\\/li>\\n<li>Fix error with wrong class name \\\"FrmTransSubscriptionsController\\\"<\\/li>\\n<li>Remove usage of deprecated FrmDb class<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-stripe\\/formidable-stripe.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"168460\":{\"title\":\"Twilio\",\"name\":\"Twilio\",\"slug\":\"twilio\",\"version\":\"1.09\",\"new_version\":\"1.09\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-twilio\\/formidable-twilio-1.09.zip\"],\"excerpt\":\"Allow users to text their votes for polls created by Formidable Forms, or send SMS notifications when entries are submitted or updated.\",\"id\":168460,\"released\":\"2014-03-10 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/twilio-add-on\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/twilio\\/\",\"changelog\":\"<h4>v1.09 - November 2, 2020<\\/h4>\\n<ul>\\n<li>New: Include sending numbers from the linked Twilio account in a dropdown. This makes it much easier to send messages successfully.<\\/li>\\n<li>New: Process the [default-message] when sending in an SMS message.<\\/li>\\n<li>Add more guidance to connect to the Twilio API and show messages in the form action when connecting fails.<\\/li>\\n<li>Fix: Some responses were not getting saved correctly into radio and checkbox fields.<\\/li>\\n<li>Clean up and update the code including removing support for Formidable &lt;2.0.<\\/li>\\n<\\/ul>\\n<h4>v1.08 - January 16, 2017<\\/h4>\\n<ul>\\n<li>Improved: Removed deprecated instructions and screenshot.<\\/li>\\n<li>Improved: Removed deprecated valign attribute from table HTML.<\\/li>\\n<\\/ul>\\n<h4>v1.07 - November 1, 2016<\\/h4>\\n<ul>\\n<li>When an SMS message is received, run validation and respond with a text that includes any error messages<\\/li>\\n<li>When a text is received successfully, respond with the form success message, filtered list like a form does.<\\/li>\\n<li>Allow for the \\\"other\\\" fields to be filled from a text submission<\\/li>\\n<li>Check if license number is for correct plugin<\\/li>\\n<li>Don\'t try to send messages to a blank number<\\/li>\\n<\\/ul>\\n<h4>v1.06 - November 13, 2015<\\/h4>\\n<ul>\\n<li>Add frmtwlo_format_number filter for formatting the phone number before it\'s sent to Twilio<\\/li>\\n<li>Fix license activation<\\/li>\\n<\\/ul>\\n<h4>v1.05 - October 16, 2015<\\/h4>\\n<ul>\\n<li>Add frmtwlo_sms_response hook for changing the message in the text<\\/li>\\n<li>Allow for 8-digit numbers. +65 phone numbers were having trouble because we assumed they should be US numbers. Now if the number starts with a +, don\'t add the +1<\\/li>\\n<li>Get updates from FormidableForms.com<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-twilio\\/formidable-twilio.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"168456\":{\"title\":\"Upload Importer\",\"name\":\"Upload Importer\",\"slug\":\"upload-importer\",\"version\":\"1.0.01\",\"new_version\":\"1.0.01\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-upload-importer\\/formidable-upload-importer-1.0.01.zip\"],\"excerpt\":\"\",\"id\":168456,\"released\":\"2015-10-16 17:05:47\",\"categories\":[\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/upload-importer\\/\",\"changelog\":\"<h4>v1.0.01<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v1.0<\\/h4>\\n<ul>\\n<li>Allow importing of multiple file uploads<\\/li>\\n<li>Replace deprecated mime_content_type with fileinfo<\\/li>\\n<li>Update auto-updating<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"173984\":{\"title\":\"User Registration\",\"name\":\"User Registration\",\"slug\":\"user-registration\",\"version\":\"2.03\",\"new_version\":\"2.03\",\"location\":[\"s3.amazonaws.com\\/fp.strategy11.com\\/releases\\/formidable-registration\\/formidable-registration-2.03.zip\"],\"excerpt\":\"Give new users access to your site quickly and painlessly. Plus edit profiles and login from the front end.\",\"id\":173984,\"released\":\"2011-12-21 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/user-registration\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/user-registration\\/\",\"changelog\":\"<h4>vv2.03 - February 4, 2021<\\/h4>\\n<ul>\\n<li>Fixed an issue with url filtering that caused issues with Polylang.<\\/li>\\n<li>The User ID field is no longer an option in registration user meta settings.<\\/li>\\n<li>The option to add user meta no longer disappears if nothing else is configured.<\\/li>\\n<li>Fixed an issue that was causing draft entries to lose data.<\\/li>\\n<li>Fixed some deprecation errors in PHP 8.<\\/li>\\n<li>Fixed an issue where adding a user meta row would change the layout.<\\/li>\\n<li>Added <span class=\\\"blob-code-inner blob-code-marker\\\" data-code-marker=\\\"+\\\"><span class=\\\"pl-s\\\">logout_redirect=\\\"https:\\/\\/example.com\\/logout-redirect\\\"<\\/span><\\/span> option to login form shortcode.<\\/li>\\n<\\/ul>\\n<h4>v2.02.02 - November 14, 2019<\\/h4>\\n<ul>\\n<li>New: Update for better 4.0 UI and setting layouts.<\\/li>\\n<li>New: Allow rich text fields in registration form action settings.<\\/li>\\n<li>New: Better multilingual support for global messages.<\\/li>\\n<li>New: Added frmreg_global_messages and frmreg_global_pages hooks.<\\/li>\\n<li>Fix: WPML compatibility - Language went back to default language after login.<\\/li>\\n<li>Fix: WPML compatibility - The email confirmation link didn\'t keep the selected language.<\\/li>\\n<li>Fix: Prevent errors when a registration form action is disabled.<\\/li>\\n<li>Fix: API calls were redirected to login page.<\\/li>\\n<li>Fix: Prevent a redirect with the reset password link. If a reset password page was selected in the global settings, the link pointed to the regular WP reset page which redirected.<\\/li>\\n<li>Fix: If custom parameters are included on the login redirect url, keep the correct encoding.<\\/li>\\n<li>Fix: Prevent a + in usernames in order to match WordPress. This was causing issues with auto login and email moderation.<\\/li>\\n<li>Fix: After a user was automatically logged in, wp_get_current_user() in other plugins wasn\'t correct.<\\/li>\\n<\\/ul>\\n<h4>v2.02.01 - September 26, 2018<\\/h4>\\n<ul>\\n<li>Allow user profile updating to be triggered after a successful PayPal payment<\\/li>\\n<li>Fix: Show a blank form to logged in users who have permission to create other users, even if they have an entry in the form<\\/li>\\n<li>New: Added frmreg_allow_edit hook for other plugins to set when profile editing is allowed<\\/li>\\n<\\/ul>\\n<h4>v2.02 - September 14, 2018<\\/h4>\\n<ul>\\n<li>New: Get the page source to check if the page includes the form specified in the global settings (login form, reset password, or registration). This allows for these forms to be included in a sidebar or footer without returning error messages when the global settings are saved.<\\/li>\\n<li>New: Add hooks to change selected pages: frmreg_login_page_id, frmreg_resetpass_page_id, frmreg_register_page_id<\\/li>\\n<li>New: Allow a subsite to be created by a logged in user<\\/li>\\n<li>Fix: Allow user creation via API call<\\/li>\\n<li>Fix: Allow either set password by email or user moderation, but not both<\\/li>\\n<li>Fix: Issue with losing parameters when redirecting for login<\\/li>\\n<li>Fix: The user ID field was defaulting to the current user on registration forms when it should be empty<\\/li>\\n<li>Fix: If an error message is included in the url for password reset, show it instead of an unknown error<\\/li>\\n<li>Fix: Update for WP 3.9 compatibility<\\/li>\\n<li>Fix: Update for deprecated functions: save_settings, FrmForm::get_id_by_key, FrmProFieldsHelper::get_displayed_file_html<\\/li>\\n<li>New: Add Chinese translations<\\/li>\\n<\\/ul>\\n<h4>v2.01.01 - October 26, 2017<\\/h4>\\n<ul>\\n<li>New: Add frmreg_after_create_subsite action.<\\/li>\\n<li>New: Add Norwegian translation.<\\/li>\\n<li>New: Add frmreg_login_error filter.<\\/li>\\n<li>Fix: Make sure show lost password and layout settings apply to widget.<\\/li>\\n<li>Fix: Convert special characters to standard characters in subdomain.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-registration\\/formidable-registration.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"170649\":{\"title\":\"User Tracking\",\"name\":\"User Tracking\",\"slug\":\"user-tracking\",\"version\":\"1.0\",\"new_version\":\"1.0\",\"location\":[\"s3.amazonaws.com\\/fp.strategy11.com\\/releases\\/formidable-user-tracking\\/formidable-user-tracking-1.0.zip\"],\"excerpt\":\"Track which pages a user visits prior to submitting a form.\",\"id\":170649,\"released\":\"2015-10-19 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-user-tracking\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/user-tracking\\/\",\"changelog\":\"<h4>v1.0 - August 25, 2016<\\/h4>\\n<ul>\\n<li>Save the tracking info before the email is sent<\\/li>\\n<li>Make sure license key is correct before saving<\\/li>\\n<\\/ul>\\n<h4>v1.0b3<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v1.0b2<\\/h4>\\n<ul>\\n<li>Skip tracking wp-admin\\/ajax.php<\\/li>\\n<li>Remove base url from page list<\\/li>\\n<li>Codestyling to meet WP standards<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-user-tracking\\/formidable-user-tracking.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"28027505\":{\"title\":\"Views\",\"name\":\"Views\",\"slug\":\"views\",\"version\":\"4.0.03\",\"new_version\":\"4.0.03\",\"location\":[\"fp.strategy11.com\\/releases\\/views\\/formidable-views-4.0.03.zip\"],\"excerpt\":\"Add the power of views to your Formidable Forms to display your form submissions in listings, tables, calendars, and more.\",\"id\":28027505,\"released\":\"2010-10-28 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase-category\\/views\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/views\\/\",\"changelog\":\"<h4>v4.0.03 - December 7, 2020<\\/h4>\\n<ul>\\n<li>New: Allow multiple ids for the view shortcode in entry_id=\'25,26\'<\\/li>\\n<li>Fix: Views weren\'t searchable by id<\\/li>\\n<li>Move code from Formidable Pro to customize post content when creating posts<\\/li>\\n<\\/ul>\\n<h4>v4.0.02 - November 9, 2020<\\/h4>\\n<p>Add a lock\\/unlock toggle in the sidebar. This will allow any boxes in the view sidebar settings to show in case something gets moved into the sidebar by accident.<\\/p>\\n\",\"plugin\":\"formidable-views\\/formidable-views.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"174006\":{\"title\":\"WooCommerce\",\"name\":\"WooCommerce\",\"slug\":\"woocommerce\",\"version\":\"1.10\",\"new_version\":\"1.10\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-woocommerce\\/formidable-woocommerce-1.10.zip\"],\"excerpt\":\"Are your WooCommerce product forms too basic? Add custom fields to a product form and collect more data when it is added to the cart.\",\"id\":174006,\"released\":\"2016-01-19 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-woocommerce\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/woocommerce\\/\",\"changelog\":\"\",\"plugin\":\"formidable-woocommerce\\/formidable-woocommerce.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"169998\":{\"title\":\"WP Multilingual\",\"name\":\"WP Multilingual\",\"slug\":\"wp-multilingual\",\"version\":\"1.09\",\"new_version\":\"1.09\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-wpml\\/formidable-wpml-1.09.zip\"],\"excerpt\":\"Translate your forms into multiple languages using the Formidable-integrated WPML plugin.\",\"id\":169998,\"released\":\"2013-04-29 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-multi-language\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/wp-multilingual\\/\",\"changelog\":\"<h4>v1.09 - February 25, 2021<\\/h4>\\n<ul>\\n<li>New: Products are now translatable.<\\/li>\\n<li>New: Translations are now sorted by field order in settings.<\\/li>\\n<li>Fix: PHP8 was frequently logging a deprecation warning.<\\/li>\\n<\\/ul>\\n<h4>v1.06 - April 4, 2019<\\/h4>\\n<ul>\\n<li>Switch back to using separate values by default for checkboxes, radio, and dropdown fields<\\/li>\\n<\\/ul>\\n<h4>v1.05 - March 6, 2019<\\/h4>\\n<ul>\\n<li>New: Added a bunch of strings for translation, and get the translatable strings from the core Formidable plugin to keep translatable strings immediately up to date. Added strings include address fields, repeaters, email confirmation label, toggle fields, global login message, global failed message, global registration strings, and others.<\\/li>\\n<li>New: Set the datepicker locale from a dropdown instead of entering the language code.<\\/li>\\n<li>New: Show the translated value in view for dropdown, radio, and checkbox fields.<\\/li>\\n<li>New: Translate field names and values in the WooCommerce cart.<\\/li>\\n<li>New: Show the translated value when showing values from fields with separate values.<\\/li>\\n<li>New: Update for a better layout with Formidable 3.0<\\/li>\\n<li>Fix: Only try to translate field options that have a translation registered.<\\/li>\\n<li>Fix: Some forms included strings from other forms with similar ids<\\/li>\\n<li>Fix: Don\'t set separate values by default for new fields<\\/li>\\n<li>Fix: Only show the unique message for translation if the field is set to be unique<\\/li>\\n<li>Fix: When the original string for a global setting was updated, the old string remained in the translation settings.<\\/li>\\n<\\/ul>\\n<h4>v1.05b2 - June 11, 2018<\\/h4>\\n<ul>\\n<li>Translate dropdown, radio, and checkboxes in views<\\/li>\\n<li>Translate field names and values in the WooCommerce cart. Show translated value when showing values from fields with separate values.<\\/li>\\n<li>Update for a better layout in Formidable v3.0+<\\/li>\\n<\\/ul>\\n<h4>v1.05b1 - June 28, 2017<\\/h4>\\n<ul>\\n<li>New: Add address labels and confirmation field to translation options<\\/li>\\n<li>Fix: Prevent extra strings from showing in the translation settings<\\/li>\\n<li>Fix: Only translate field options that need translating<\\/li>\\n<\\/ul>\\n<h4>v1.04 - October 25th, 2016<\\/h4>\\n<ul>\\n<li>Allow translation of Add\\/Remove buttons<\\/li>\\n<li>Replace some deprecated WPML function calls and constants<\\/li>\\n<li>Make sure wpml strings are updated when form is updated<\\/li>\\n<li>Do not translate default value for all field types<\\/li>\\n<li>Make sure incorrect field message is translated with ajax submit<\\/li>\\n<\\/ul>\\n<h4>v1.03.03 - March 28, 2016<\\/h4>\\n<ul>\\n<li>Send the language in the ajax url differently to prevent 404s during ajax calls. This should help with duplicate submissions.<\\/li>\\n<li>Prevent a license key from being saved for another plugin<\\/li>\\n<\\/ul>\\n<h4>v1.03.02<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<li>Make it compatible with the free version of Formidable<\\/li>\\n<li>Fix errors when Formidable or WPML are deactivated<\\/li>\\n<li>Include the current language during ajax calls<\\/li>\\n<li>Force an English start language for strings for v2.2.6 of the WPML strings plugin<\\/li>\\n<li>Fix the issue with the default language in WPML being set different than the string language<\\/li>\\n<li>If values in the form settings page changed, update them when going to the translation settings<\\/li>\\n<li>Make sure the \\\"previous\\\" label is translatable when drafts are not enabled<\\/li>\\n<li>Don\'t show strings for inactive languages<\\/li>\\n<li>Translate fields in repeating sections<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-wpml\\/formidable-wpml.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}},\"170645\":{\"title\":\"Zapier\",\"name\":\"Zapier\",\"slug\":\"zapier\",\"version\":\"2.01\",\"new_version\":\"2.01\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-zapier\\/formidable-zapier-2.01.zip\"],\"excerpt\":\"Connect with hundreds of applications through Zapier. Automatically insert a Google spreadsheet row, tweet, or upload to Dropbox.\",\"id\":170645,\"released\":\"2014-06-04 00:00:00\",\"categories\":[\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-zapier\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/zapier\\/\",\"changelog\":\"<h4>v2.0 - September 14, 2020<\\/h4>\\n<ul>\\n<li>This update requires action. After updating, click the link to migrate the old settings. <strong>Zaps will not be triggered after updating until this is completed.<\\/strong><\\/li>\\n<li>New: Move Zapier settings to form actions. This allows for conditional logic and form action automation to be used from the Formidable end.<\\/li>\\n<li>New: Better logging for more info for both incoming and outgoing API calls for easier debugging.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - September 14, 2020<\\/h4>\\n<p>Fix: Javascript error showing when migration was started<\\/p>\\n<h4>v1.06 - February 6, 2019<\\/h4>\\n<ul>\\n<li>Add a new fallback for authentication with the API key in the url. When the API key continues to say it is missing, add add_filter( \'frm_zap_url_auth\', \'__return_true\' ); in the theme functions.php.<br \\/>\\nThen use this url in Zapier:<br \\/>\\nhttps:\\/\\/yoursite.com\\/API-KEY-GOES-HERE\\/\\n<\\/li>\\n<li>New: Add frm_zap_sent hook to run after an entry is sent to Zapier<\\/li>\\n<li>Fix: Don\'t send draft entries to Zapier<\\/li>\\n<li>Added automation to release new versions<\\/li>\\n<\\/ul>\\n<h4>v1.05 - July 31, 2018<\\/h4>\\n<ul>\\n<li>New: Add frmzap_entry_array filter to customize the entry values sent to Zapier<\\/li>\\n<li>New: Add logging of Zapier responses into the Logs addon<\\/li>\\n<li>Fix: Prevent a blank response when fetching the list of forms. This was happening on some sites with a lot of forms<\\/li>\\n<\\/ul>\\n<h4>v1.04 - July 31, 2017<\\/h4>\\n<p>Fix a conflict with API keys between the Zapier and API addons on a multisite network. This solves the issue with the incorrect API key error message in Zapier.<\\/p>\\n\",\"plugin\":\"formidable-zapier\\/formidable-zapier.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"}}}\";s:7:\"version\";s:7:\"4.10.01\";}', 'no');
