(17, 1, '2021-04-27 10:56:23', '2021-04-27 08:56:23', '<p><!-- wp:columns --></p><h1>Agence Songré vous proposes plusieurs services</h1><p><!-- /wp:columns --></p>		\n												<figure>\n										<img width=\"225\" height=\"225\" src=\"http://localhost/agence_web/wordpress/wp-content/uploads/2021/04/agence-web.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/agence_web/wordpress/wp-content/uploads/2021/04/agence-web.png 225w, http://localhost/agence_web/wordpress/wp-content/uploads/2021/04/agence-web-150x150.png 150w\" sizes=\"(max-width: 225px) 100vw, 225px\" />											<figcaption>Vous trouverez les meilleurs choses à l\'agence Songré</figcaption>\n										</figure>\n												<figure>\n										<img width=\"225\" height=\"225\" src=\"http://localhost/agence_web/wordpress/wp-content/uploads/2021/04/agencesweb.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/agence_web/wordpress/wp-content/uploads/2021/04/agencesweb.png 225w, http://localhost/agence_web/wordpress/wp-content/uploads/2021/04/agencesweb-150x150.png 150w\" sizes=\"(max-width: 225px) 100vw, 225px\" />											<figcaption>Songré vous proposes des sites adaptées à votre commerces </figcaption>\n										</figure>\n												<figure>\n										<img width=\"225\" height=\"225\" src=\"http://localhost/agence_web/wordpress/wp-content/uploads/2021/04/agence-web.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/agence_web/wordpress/wp-content/uploads/2021/04/agence-web.png 225w, http://localhost/agence_web/wordpress/wp-content/uploads/2021/04/agence-web-150x150.png 150w\" sizes=\"(max-width: 225px) 100vw, 225px\" />											<figcaption>La satisfaction du client est aussi  une de notre preoccupation</figcaption>\n										</figure>\n												<figure>\n										<img width=\"225\" height=\"225\" src=\"http://localhost/agence_web/wordpress/wp-content/uploads/2021/04/agencesweb.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/agence_web/wordpress/wp-content/u